const UserModal = ({ userInfo }) => {
  const infoContainer = Object.entries(userInfo);
  const renderedArr = infoContainer.map(([key, value]) => {
    console.log(key, value);
    return (
      <div key={key}>
        {key}: {value}
      </div>
    );
  });

  return (
    <div className="modal">
      <div className="modal__body">{}</div>
    </div>
  );
};

export default UserModal;
